import React from "react";
import BackToTop from "../backToTop/BackToTop";
import {
  BrowserRouter,
  Route,
  Switch,
  useRouteMatch,
  Link,
} from "react-router-dom";

export default function Contact() {
  const match = useRouteMatch();
  console.log({ match });
  return (
    <>
      <BackToTop />
      <BrowserRouter>
        <ul>
          <li>
            <Link to="/con/page1">page 1</Link>
          </li>
          <li>
            <Link to="/page2">page 2</Link>
          </li>
          <li>
            <Link to="/page3">page 3</Link>
          </li>
        </ul>
        <Switch>
          <Route exact path={`${match.url}/page1`} component={<h1>page1</h1>} />
          <Route path={`${match.url}/page2`} component={<h1>page2</h1>} />
          <Route path={`${match.url}/page3`} component={<h1>page3</h1>} />
          <Route component={<h1>NOT FOUND!</h1>} />
        </Switch>
      </BrowserRouter>
    </>
  );
}
